pragma solidity ^0.8.24;

import "./interfaces/IAggregationExecutor.sol";
import {IERC20} from "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract AggregatorExecution is IAggregationExecutor {
    function callBytes(bytes calldata _data) external payable {
        (address router, bytes memory data) = abi.decode(
            _data,
            (address, bytes)
        );
        (bool success, ) = router.call(data);
        require(success, "CallBytes failed");
    }

    function swapSingleSequence(bytes calldata _data) external {
        (address SwapRouter, address tokenIn, bytes memory swapData) = abi.decode(
            _data,
            (address, address, bytes)
        );

        (bool success, ) = SwapRouter.call(swapData);
        require(success, "CallBytes failed");
    }

    function finalTransactionProcessing(
        address tokenIn,
        address tokenOut,
        address to,
        bytes calldata destTokenFeeData
    ) external {

    }
}

